import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom'
import axios from 'axios';

export default function TransactionIndividual(){

    let { id } = useParams();
    const [ transactionPost, setTransactioPost ] = useState({
        id:0,
        concept: '',
        comment: '',
        date: '',
        type: ''
    })

    useEffect(() => {
        axios.get(`http://localhost:3001/transaction/${id}`, {
            headers: {
                "token": localStorage.getItem("token")
            }
        })
        .then((response) => {
            setTransactioPost(response.data)
        })
    }, [])

    console.log(transactionPost)
    return(
        <div>
           <h1>
               {transactionPost.amount}
           </h1>
        </div>
    )
}
